import Hero from "../components/Hero";
import Navbar from "../components/Navbar";
import aboutimage from "../assests/aboutimage.jpg";

function About(){
    return(
     <>
      <Navbar/>
    <Hero
    cName ="hero"
    heroImage ={aboutimage}
    title = "WELCOME TO DIIMPLE'S OFFICIAL PHOTOGRAPHY WEBSITE"
    text ="CREATIVITY TAKES COURAGE... "
    text2  = "TAKING PICTURES IS SAVORING LIFE INTENSELY,"
    text3 ="EVERY HUNDREDTH OF A SECOND PHOTOGRAPHY IS A"
    text4 = "PICTURE PAINTED BY THE SUN WITHOUT INSTRUCTION IN ART"
    text5 = "VISION BEYOND THE LENS..."
    url ="/"
    />
     </>
    )
 }
 
 
 export default About;
